import React from 'react';
import styled from "styled-components";

const CardBlock = styled.div`
    display: inline-block;
    background-color: #F8F9FA;
`

const CardEach = styled.div`
    background-color: white;

`



const CardText = styled.p`
    font-size: 15px;
    text-align: center;
    margin-top: 20px;
    margin-bottom: 20px;
    margin-left: 15px;
    margin-right: 15px;
`

const CardButton = styled.div`
    display: flex;
    flex-direction: row;
    margin-left: 15px;
    margin-bottom: 20px;

`

const Thumbnail = styled.div`
    background-color: black;
    color: white;
    text-align: center;
`


const CardButton1 = styled.button`
    

`

const CardButton2 = styled.button`
    
    
`

const CardTime = styled.p`
    
`



const Card = () => {
    return (
        <CardBlock>
            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>



        </CardBlock>
    );
};

export default Card;
